	add("artfag", "{\"term\":\"artfag\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|art|fag|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A pretentious artist or person interested in the arts\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1997\u0027\u0027, Jeffrey DeShell, \u0027S \u0026amp; M\u0027, FC2 (1997), ISBN 1573660248, [http://books.google.com/books?id\u003dVFx9uUrfz6cC\u0026amp;pg\u003dPA136\u0026amp;dq\u003d%22artfags%2\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22artfags%22\u0026amp;f\u003dfalse page 136\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"I was still really horny but my lust wasn\u0027t directed at anyone in particular it was sort of a generalized desire maybe my standards were too high but after a while the thought of fucking another one of those stuck up pomo boho \u0027\u0027artfags\u0027\u0027 really turned my stomach\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Garth Stein, \u0027How Evan Broke His Head and Other Secrets\u0027, Soho Press (2004), ISBN 1569473900, [http://books.google.com/books?id\u003dD9ecZGH_4AIC\u0026amp;pg\u003dPT57\u0026amp;dq\u003d%22artfags%2\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22artfags%22\u0026amp;f\u003dfalse unnumbered page\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"‚ÄúSomeone posted on the Internet that Tom Waits was showing up. I guess they all figure if Tom Waits shows, Jim Jarmusch might show because he\u0027s shooting a film in Portland, and they figure if Jim Jarmusch shows, Johnny Depp can\u0027t be too far behind. So, therefore, you get all these loser \u0027\u0027artfags\u0027\u0027 going to a see a band they\u0027ve never heard of before tonight\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Stacy Pershall, \u0027Loud in the House of Myself: Memoir of a Strange Girl\u0027, W. W. Norton \u0026amp; Company (2011), ISBN 9780393066920, [http://books.google.com/books?id\u003dGUQkxIGR_jMC\u0026amp;pg\u003dPA107\u0026amp;dq\u003d%22artfags%2\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22artfags%22\u0026amp;f\u003dfalse page 107\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"As I popped open the blister packs, I thought of all the other things I could be doing: writing a story, reading a story, dancing with the \u0027\u0027artfags\u0027\u0027, protesting something\", \"priority\":10}]}, \"synonyms\":{}}");

	add("artfuck", "{\"term\":\"artfuck\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|art|fuck|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A pretentious artist or person interested in the arts\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1999\u0027\u0027, Maggie Estep, \u0027Soft Maniacs\u0027, Simon \u0026amp; Schuster (1999), ISBN 9780684863337, [http://books.google.ca/books?id\u003dzbJaAAAAMAAJ\u0026amp;q\u003d%22artfuck%22\u0026amp;dq\u003d%22artfuck%22\u0026amp; page 121\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"I even had the balls to hit Barneys, which actually wasn\u0027t that remarkable since, the way I look, it\u0027s hard to tell if I\u0027m some deliberately disheveled successful \u0027\u0027artfuck\u0027\u0027 or just a down-and-out guy\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Christopher R. Weingarten, \u0026quot;[http://books.google.com/books?id\u003daV6sAs1q4hYC\u0026amp;pg\u003dPA12-IA4\u0026amp;dq\u003d%22artfucks%2\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22artfucks%22\u0026amp;f\u003dfalse Spotlight: Liars]\u0026quot;, \u0027CMJ New Music Report\u0027, 23 February 2004\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Since then, Liars severed ties with both their rhythm section and their metropolitan ways, deserting a borough infested with unwashed \u0027\u0027artfucks\u0027\u0027 for the forests of New Jersey\", \"priority\":6}]}, \"synonyms\":{}}");

