	add("articulation", "{\"term\":\"articulation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"From Old french (842-ca. 1400) \u0027articulacion\u0027 from \u0027articulatio\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A joint or the collection of joints at which something is articulated, or hinged, for bending\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027articulation\u0027\u0027 allowed the robot to move around corners\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A manner or method by which elements of a system are connected\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The quality, clarity or sharpness of speech\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"His volume is reasonable, but his \u0027\u0027articulation\u0027\u0027 could use work\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The manner in which something is articulated (tongued, slurred or bowed\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027articulation\u0027\u0027 in this piece is tricky because it alternates between legato and staccato\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The interrelation and congruence of the flow of data between financial statements of an entity, especially between the income statement and balance sheet\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"1991\u0027\u0027, Stephen P. Taylor, ‚ÄúFrom Moneyflows Accounts to Flow-of-Funds Accounts‚Äù, printed in John C. Dawson (editor), \u0027Flow-of-Funds Analysis: A Handbook for Practitioners\u0027, M.E. Sharpe (1996), ISBN 978-1-56324-645-6, [http://books.google.com/books?id\u003dYUZv_8BvlLAC\u0026amp;pg\u003dPA103\u0026amp;dq\u003darticulation page 103\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"At the time the outstanding distinction that could be seen between Copeland-Fed on the one hand and Goldsmith-Friend on the other was that the flow-of-funds system explicitly included nonfinancial transactions in the statistical structure in direct \u0027\u0027articulation\u0027\u0027 with financial flows and stocks\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, David T. Collins, ‚ÄúAccounting and Financial Reporting Issues‚Äù, Chapter 6 of Robert L. Brown and Alan S. Gutterman (editors), \u0027Emerging Companies Guide: A Resource for Professionals and Entrepreneurs\u0027, American Bar Association, ISBN 978-1-59031-466-1, [http://books.google.com/books?id\u003dXqDniFJ5CWQC\u0026amp;pg\u003dPA169\u0026amp;dq\u003darticulation page 169\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Particular income statement accounts (revenues and expenses) are linked to particular balance sheet accounts (assets and liabilities); that is, there is \u0027\u0027articulation\u0027\u0027 between the income statement and the balance sheet\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Roger L. Burritt, ‚ÄúChallenges for Environmental Management Accounting‚Äù, Chapter 2 of Pall M. Rikhardsson et al. (editors), \u0027Implementing Environmental Management Accounting: Status and Challenges\u0027, Springer, ISBN 978-1-4020-3371-1, [http://books.google.com/books?id\u003dK1WABw4eGjgC\u0026amp;pg\u003dPA28\u0026amp;dq\u003darticulation page 28\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"The emphasis on articulated information about environmental liabilities in the management accounts is not stressed. \u0027\u0027Articulation\u0027\u0027 between stock and flow information in physical environment terms receives less attention\", \"priority\":14}]}, \"synonyms\":{}}");

