	add("artifact", "{\"term\":\"artifact\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Italian\", \"Latin\"], \"text\":\"Alteration of \u0027\u0027 from Italian \u0027artefatto\u0027 from Latin \u0027arte\u0027 (lang\u003dla) (ablative of \u0027ars\u0027 (lang\u003dla) + \u0027factum\u0027 (lang\u003dla) from \u0027facio\u0027 (lang\u003dla)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An object made or shaped by human hand\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An object, such as a tool, weapon or ornament, of archaeological or historical interest, especially such an object found at an archaeological excavation\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The dig produced many Roman \u0027\u0027artifacts\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Something viewed as a product of human conception or agency rather than an inherent element\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Philip Weis\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The very act of looking at a naked model was an \u0027\u0027artifact\u0027\u0027 of male supremacy\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A structure or finding in an experiment or investigation that is not a true feature of the object under observation, but is a result of external action, the test arrangement, or an experimental error\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The spot on his lung turned out to be an \u0027\u0027artifact\u0027\u0027 of the X-ray process\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A structure or appearance in protoplasm due to death, method of preparation of specimens, or the use of reagents, and not present during life\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"An object made or shaped by some agent or intelligence, not necessarily of direct human origin\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A perceptible distortion that appears in a digital image, audio or video file as a result of applying a lossy compression algorithm\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"This JPEG image has been so highly compressed that it has too many unsightly compression \u0027\u0027artifacts\u0027\u0027, making it unsuitable for the cover of our magazine\", \"priority\":12}]}, \"synonyms\":{}}");

