	add("artillery", "{\"term\":\"artillery\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\"], \"text\":\"Middle english (1100-1500) \u0027artillerie\u0027 from Old french (842-ca. 1400) \u0027artillerie\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Large cannon-like weapons, transportable and usually operated by more than one person\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Bible, 1 Sam. xx. 4\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"And Jonathan gave his \u0027\u0027artillery\u0027\u0027 unto his lad\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An army unit that uses such weapons\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Gunnery\", \"priority\":5}]}, \"synonyms\":{}}");

