	add("artisan", "{\"term\":\"artisan\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"French\", \"Latin\"], \"text\":\"From French \u0027lang\u003dfr\u0027 from {{m|la|*artitianus}}, from Latin \u0027artitus\u0027 (skilled) past participle of {{m|la|arti≈ç||I instruct in arts}}, from \u0027ars\u0027 (art, skill)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A skilled manual worker who uses tools and machinery in a particular craft\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A person who displays great dexterity\", \"priority\":2}]}, \"synonyms\":{}}");

	add("artisanality", "{\"term\":\"artisanality\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|artisan|ality|lang\u003den}} or possibly \u0027artisanal\u0027 + \u0027-ity\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state or quality of being an artisan\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1995\u0027\u0027, Richard A. Posner, \u0027Overcoming Law\u0027, [http://books.google.com.au/books?id\u003d3B0hm35X2JEC\u0026amp;pg\u003dPA46\u0026amp;dq\u003d%22artisanality%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dGIITUf-sNMOlkAWFhICYDg\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22artisanality%22\u0026amp;f\u003dfalse page 46\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The spirit of \u0027\u0027artisanality\u0027\u0027 is captured in the nineteenth-century ‚Äúarts and crafts‚Äù movement, which ‚Äúemphasized the human touch ‚Äî the care, craftsmanship and attention to detail that go into a piece of furniture or a decorative object that is crafted by hand. The art of creating something, it was thought, should be a joyful, exhilarating experience, not just a way of earning money.‚Äù\u0026lt;sup\u0026gt;18\u0026lt;/sup\u0026gt\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Matthew Fort, \u0027Eating Up Italy: Voyages on a Vespa\u0027, [http://books.google.com.au/books?id\u003dp9H7rh-DtUcC\u0026amp;pg\u003dPA45\u0026amp;dq\u003d%22artisanality%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dGIITUf-sNMOlkAWFhICYDg\u0026amp;redir_esc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22artisanality%22\u0026amp;f\u003dfalse page 45\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"He gave off an aura not of romance or woolly \u0027\u0027artisanality\u0027\u0027 but rather of canny commercial nous\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Vera Keller, \u0027How to Become a Seventeenth-Century Natural Philosopher: The Case of Cornelis Drebbel (1572-1633)\u0027, Sven Dupr√©, Christoph L√ºthy (editors), \u0027Silent Messengers: The Circulation of Material Objects of Knowledge in the Early Modern Low Countries\u0027, [http://books.google.com.au/books?id\u003d1qD6kyg055sC\u0026amp;pg\u003dPA125\u0026amp;dq\u003d%22artisanality%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dGIITUf-sNMOlkAWFhICYDg\u0026amp;redir_esc\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22artisanality%22\u0026amp;f\u003dfalse page 125\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"The printed editions of Drebbel‚Ä≤s works thus allow us to trace circulation between a culture of \u0027\u0027artisanality\u0027\u0027 sure enough of its own authority to stake claims to knowledge in print, and an academic culture appreciative enough of \u0027\u0027artisanality\u0027\u0027 to support those claims through both erudition and elegance\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"The state or quality of being artisanal (made by artisans or involving the work of artisans, with comparatively little reliance on machinery\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Anya Fernald, \u0027A World Of Presidia: Food, Culture \u0026amp; Community\u0027, [http://books.google.com.au/books?id\u003drShIAAAAYAAJ\u0026amp;q\u003d%22artisanality%22\u0026amp;dq\u003d%22artisanality%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dGIITUf-sNMOlkAWFhICYDg\u0026amp;redir_esc\u003dy page 13\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"Aspects such as links to the territory, \u0027\u0027artisanality\u0027\u0027 and the size and sustainability of producer organizations are evaluated, and if the product meets the necessary requirements, it is then ready to join the Ark of Taste\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, w:Murray Murray Pomerance, \u0027The Horse Who Drank the Sky: Film Experience Beyond Narrative and Theory\u0027, [http://books.google.com.au/books?id\u003diaHpz5xY5IIC\u0026amp;pg\u003dPA29\u0026amp;dq\u003d%22artisanality%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dGIITUf-sNMOlkAWFhICYDg\u0026amp;redir_esc\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22artisanality%22\u0026amp;f\u003dfalse page 29\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"With early films, the viewer could not but be conscious of the \u0027\u0027artisanality\u0027\u0027 of the work; with narrative film, as Belton (1985) and others have shown, the cinematic project was to disguise the \u0027\u0027artisanality\u0027\u0027 of the work as much as possible so as to seduce the viewer‚Ä≤s complivity and engagement; further, the increasingly elaborate mechanism of studio production from 1930 onward meant that \u0027\u0027artisanality\u0027\u0027 was also being hidden by‚Äîindeed, transformed into‚Äîthe systematic mechanical operation of well-organized and interlocking parts\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Christina Stringer, \u0027Agri-Food Commodity Chains and Globalising Networks\u0027, [http://books.google.com.au/books?id\u003d0AQXL1N-yYIC\u0026amp;pg\u003dPA115\u0026amp;dq\u003d%22artisanality%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dGIITUf-sNMOlkAWFhICYDg\u0026amp;redir_esc\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22artisanality%22\u0026amp;f\u003dfalse page 115\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"The identity dovetails with images of environmental purity, \u0027\u0027artisanality\u0027\u0027, adaptability, competitiveness, creativity, and sophistication\", \"priority\":19}]}, \"synonyms\":{}}");

